/**
 * @typedef {import('../types/icon-names').IconName} IconName
 * @param {object} props
 * @param {IconName} props.name - The name of the icon to display (e.g., 'home').
 * @param {string} [props.className] - Optional additional CSS classes.
 * @param {string} [props.fill] - Optional fill color, defaults to 'currentColor'.
 * @param {string} [props.size] - Optional size, defaults to '20px'.
 */

export const Icon = ({ name, className = '', fill = 'currentColor', size = '20px', ...props }) => {
  const svgPath = ICONS[name];

  if (!svgPath) {
    console.warn(`Icon "${name}" not found.`);
    return null;
  }

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      height={size}
      viewBox="0 -960 960 960" // Ensure strict source consistency here
      width={size}
      fill={fill}
      className={className}
      aria-hidden="true"
      {...props} // <--- Allows onClick, id, etc.
    >
      {svgPath}
    </svg>
  );
};